import React from 'react';
import styled from 'styled-components';
import { colors } from '../../styles';

const P = styled.p`
  /* margin-top: -40px; */
  font-size: 20px;
  line-height: 1.6;
  color: ${colors().navy1};
  padding-bottom: 30px;
`;

function Paragraph() {
  return <div></div>;
}

export default Paragraph;
